import styled from "styled-components"
import Logo from "../logo/logo";
import EURUSrate from "../EURUSrate/EURUSrate";

const NavBar = () => {
    return <Section><Title><Logo/>ORTEX</Title> <EURUSrate></EURUSrate></Section>
}

export default NavBar;

const Section = styled.header`
  border-bottom: 1px solid white;
  margin: 0;
  padding: 0;
  width: 100%;
  height: 5.5rem;

`

const Title = styled.h1`
    width: 50%;
    padding-top: 0.5em;
    font-weight: 200;
    letter-spacing: 10px;
    display: flex;

`
